import { REGISTER, LOGIN } from "../action-types";

const initialState = {
    id: 0,
    name: '',
    surname: '',
    email: '',
    password: '',
    text: '',
    users: []
}; 

export default (state = initialState, action) => {
    switch(action.type){
        case REGISTER: 
            return {...state}
        case LOGIN: 
            return {...state}



        default: return state;
    }
}
